import React from "react";
import "./Navigation.css";
import { Link } from "react-router-dom";

const Navigation = ({ currentUser, setCurrentUser }) => {
  return (
    <div className="Nav">
      <div className="buttons">
        <Link className="nav-icon" to="/" style={{ marginLeft: "1.5rem" }}>
          <img src="/icons/Home-button.png" alt="image" />
        </Link>
        <Link className="nav-icon" to="">
          <img src="/icons/Search-results.png" alt="image" />
        </Link>
        {currentUser && (
          <Link className="nav-icon profile-login" to="">
            <img src="/icons/Setting-icon.png" alt="image" />
          </Link>
        )}
        {!currentUser && (
          <Link className="nav-icon profile-logout" to="">
            <img src="/icons/Setting-icon.png" alt="image" />
          </Link>
        )}

        {currentUser && (
          <Link className="nav-icon" to="" style={{ marginRight: "1.5rem" }}>
            <img src="/icons/profile-avatar.png" alt="image" />
          </Link>
        )}
      </div>
    </div>
  );
};

export default Navigation;
